import React from "react";
import "./site.css";
import map from "./map";
import { BrowserRouter as Router, Route } from "react-router-dom";
function Contact() {
  return (
    <Router>
      <Nav />
      <Route path="/contact" exact component={map} id="app" />
    </Router>
  );
}

export default Contact;
